import React, { Component } from 'react'
import './Header.css'

class Header extends Component {
  constructor() {
    super();
    this.state = {
      text: 'makes'
    }
    this.onMouseover = this.onMouseover.bind(this)
    this.onMouseout = this.onMouseout.bind(this)
  }
  //set the text
  onMouseover(e) {
    this.setState({
      text: 'breaks'
    })
  }
  //clear the text
  onMouseout(e) {
    this.setState({
      text: 'makes'
    })
  }
  render() {
    const { text } = this.state;
    return (
      <div id="header__body" className="glitch header">
        <h1 id='header__title1' className="back">Jeremy</h1>
        <br/>
        <h1 id='header__title2' className="middle"><span>makes</span></h1>
        <br/>
        <h1 id='header__title3' className="front">stuff</h1>
        <div id="header__split1"></div>
        <div id="header__split2"></div>
      </div>
    )
  }
}

export default Header
